import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Button, StyleSheet, Text, View, TouchableOpacity ,TouchableHighlight} from 'react-native';
import { createAppContainer } from 'react-navigation';
import { createStackNavigator } from 'react-navigation-stack';


export default class homepage extends React.Component {

    constructor(props) {
        super(props);
        this.buttonPressSlot = this.buttonPressSlot.bind(this);
        this.buttonPressmyprof = this.buttonPressmyprof.bind(this);
        this.buttonPressabout = this.buttonPressabout.bind(this);
    }

    buttonPressSlot() {
        console.log('called..');
        this.props.navigation.navigate('bookhere');
    }
    buttonPressmyprof() {
        console.log('called');
        this.props.navigation.navigate('myprof');
    }
    buttonPressabout() {
        console.log('called');
        this.props.navigation.navigate('Aboutu');
    }

    render() {

        const buttonStylesubmit = {
            color: "#FFFFFF",
            backgroundColor: "#008484",
            paddingBottom: 17,
            paddingTop: 3,
            paddingRight: 18,
            paddingLeft: 18,
            //fontFamily: "calibri",
            fontSize: 35,
            marginRight: 80,
            height: 60,
            width: 350,
            borderWidth: 6,
            borderColor: "#FFFFFF",
            marginLeft: 55,
            marginBottom: 40
        }

        return (
            <View style={styles.container}>
                <View style={styles.RectangleShapeView}>
                    <Text style={styles.textHeading}>Home</Text>
                </View>
                <View style={styles.RectangleShapeout}>
                
                        <TouchableHighlight
                            style={buttonStylesubmit}
                            //underlayColor="white"
                            onPress={this.buttonPressSlot}
                        >
                            <Text>Book My Slot</Text>
                        </TouchableHighlight>
                    
                    <View>
                        <Button style={buttonStylesubmit} onPress={this.buttonPress} title="My Profile"></Button>
                    </View>
                    <View>
                        <Button style={buttonStylesubmit} onPress={this.buttonPressabout} title="About Us"></Button>
                    </View>

                </View>
                <View style={styles.RectangleShapedown}></View>
            </View>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#FFFFFF',
        alignItems: 'center',
        justifyContent: 'center'
    },
    RectangleShapeView: {

        marginTop: 25,
        width: 450,
        height: 150,
        backgroundColor: '#008484',
        marginBottom: 5,
        textAlign: 'center'
    },
    RectangleShapeout: {

        marginTop: 25,
        width: 450,
        height: 300,
        backgroundColor: '#FFFFFF',
        marginBottom: 5,
        textAlign: 'center',
        //borderWidth:6,
        //borderColor:'#008484'
    },
    RectangleShapedown: {

        width: 450,
        height: 80,
        backgroundColor: '#008484',
        textAlign: 'center',
    },
    textHeading: {
        color: "#FFFFFF",
        fontSize: 40,
        //fontFamily: "calibri",
        paddingTop: 60
    },
});
